	  this.fft1d = function (re, im) {
	    fft(re, im, 1);
	  }
	    
	  // 1D-IFFT
	  this.ifft1d = function (re, im) {
	    var n = 1/_n;
	    fft(re, im, -1);
	    for(var i=0; i<_n; i++) {
	      re[i] *= n;
	      im[i] *= n;
	    }
	  }
	  
